import { Tabs, TabsContent, TabsList, TabsTrigger } from './components/ui/tabs';
import { Card, CardContent } from './components/ui/card';
import { SettingsProvider } from './context/SettingsContext';
import Dashboard from './pages/Dashboard';
import BookingForms from './pages/BookingForms';
import Appointments from './pages/Appointments';
import Settings from './pages/Settings';

function App() {
  return (
    <SettingsProvider>
      <div className="wda-min-h-screen wda-p-4 wda-bg-background">
        <Card className="wda-mx-auto wda-max-w-7xl">
          <CardContent className="wda-p-6">
            <Tabs defaultValue="dashboard" className="wda-w-full">
              <TabsList className="wda-grid wda-w-full wda-grid-cols-4">
                <TabsTrigger value="dashboard">Dashboard</TabsTrigger>
                <TabsTrigger value="booking-forms">Booking Forms</TabsTrigger>
                <TabsTrigger value="appointments">Appointments</TabsTrigger>
                <TabsTrigger value="settings">Settings</TabsTrigger>
              </TabsList>
              <TabsContent value="dashboard">
                <Dashboard />
              </TabsContent>
              <TabsContent value="booking-forms">
                <BookingForms />
              </TabsContent>
              <TabsContent value="appointments">
                <Appointments />
              </TabsContent>
              <TabsContent value="settings">
                <Settings />
              </TabsContent>
            </Tabs>
          </CardContent>
        </Card>
      </div>
    </SettingsProvider>
  );
}

export default App;
